  `payWord` varchar(200) DEFAULT NULL COMMENT '支付密码',
  `releaseTime` date DEFAULT NULL COMMENT '释放时间',
  `maxProfits` decimal(16,4) DEFAULT '0.0000' COMMENT '预期最大收益',
  `sumProfits` decimal(16,4) DEFAULT '0.0000' COMMENT '累计收益',
  `cashOutProfits` decimal(16,4) DEFAULT '0.0000' COMMENT '累计提现收益',
