  `remark` varchar(2000) DEFAULT NULL COMMENT '备注',
  `insuranceAmt` decimal(16,4) DEFAULT '0.0000' COMMENT '用户保单金额',
  `historySumProfits` decimal(16,4) DEFAULT '0.0000',
