  `orderNo` varchar(100) NOT NULL DEFAULT '' COMMENT '订单号',
  `sendUserId` varchar(32) DEFAULT NULL COMMENT '用户Id',
  `taskCycle` int(8) DEFAULT '0' COMMENT '需要累计完成任务次数  默认为7  依次递减  为0表示完成一个周期  可领取一次奖励',
  `signCycle` int(8) DEFAULT '4' COMMENT '一笔奖励划分多少次领取  默认为4  依次递减    可领取一次奖励  为0表示这笔分成奖励全部领完了  ',
  `receviceUserId` varchar(32) DEFAULT NULL COMMENT '用户Id',
  `amt` decimal(10,2) DEFAULT '0.00' COMMENT '交易金额 此处是人民币',
  `confirmAmt` decimal(10,2) DEFAULT '0.00' COMMENT '实际到账金额',
  `poundage` decimal(10,2) DEFAULT NULL COMMENT '手续费',
  `source` tinyint(2) DEFAULT NULL COMMENT '来源： 1：保单，2、直推奖  3、管理奖  4、级差奖    5、平级奖   6、每周收益  7:原点升级  8：覆盖升级',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `status` tinyint(2) DEFAULT NULL COMMENT '状态：1：待结算，2：已结算，3：取消结算',
  `remark` varchar(2000) DEFAULT NULL COMMENT '备注',
  `cardGrade` int(11) DEFAULT '1' COMMENT '卡的等级',
  `pushFirstReferrerScale` decimal(10,2) DEFAULT '0.00' COMMENT '一级分销',
  `pushSecondReferrerScale` decimal(10,2) DEFAULT '0.00' COMMENT '二级分销',
  `equityAmtScale` decimal(16,4) DEFAULT '0.0000' COMMENT '股权币比例',
  `payAmtScale` decimal(16,4) DEFAULT '0.0000' COMMENT '支付币比例',
  `tradeAmtScale` decimal(16,4) DEFAULT '0.0000' COMMENT '交易币比例',
  PRIMARY KEY (`id`,`orderNo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='结算订单表';

