DROP TABLE IF EXISTS `trade_record_detail`;
CREATE TABLE `trade_record_detail` (
  `id` varchar(32) NOT NULL COMMENT '主键',
  `orderNo` varchar(100) DEFAULT NULL COMMENT '订单号',
  `userId` varchar(32) DEFAULT NULL COMMENT '用户Id',
  `amount` decimal(10,2) DEFAULT NULL COMMENT '交易数量',
  `recordType` tinyint(2) DEFAULT NULL COMMENT '与币相关 流水类型：1、扣除账户交易币   2、 扣除账户支付币  3、直推奖交易币奖励 4、直推奖支付币奖励  5、直推奖股权币奖励  6、管理奖交易币奖励 7、管理奖支付币奖励 8、管理奖股权币奖励 9、级差奖交易币奖励 10、级差奖支付币奖励 11、级差奖股权币奖励   12、平级奖交易币奖励 13、平级奖支付币奖励 14、平级奖股权币奖励  15、每周收益交易币奖励 16、每周收益支付币奖励 17、每周收益股权币奖励  ',
  `firstReferrerScale` decimal(10,2) DEFAULT '0.00' COMMENT '一级分销',
  `scale` decimal(10,2) DEFAULT '0.00' COMMENT '此笔分销结算比例',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `createTime` datetime DEFAULT NULL,
  `status` tinyint(2) DEFAULT NULL COMMENT '状态',
  `remark` varchar(2000) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='交易流水明细表';

