-- ----------------------------
-- Table structure for `wallet_order`
-- ----------------------------
DROP TABLE IF EXISTS `wallet_order`;
CREATE TABLE `wallet_order` (
  `id` varchar(32) NOT NULL COMMENT '主键',
  `orderNo` varchar(100) DEFAULT NULL COMMENT '订单号',
  `sendUserId` varchar(32) DEFAULT NULL COMMENT '用户Id',
  `receviceUserId` varchar(32) DEFAULT NULL COMMENT '用户Id',
  `amount` decimal(10,2) DEFAULT NULL COMMENT '交易金额',
  `confirmAmt` decimal(10,2) DEFAULT NULL COMMENT '实际到账金额',
  `poundage` decimal(10,2) DEFAULT NULL COMMENT '手续费',
  `orderType` tinyint(2) DEFAULT NULL COMMENT ' /**\r\n     *交易币内部转账\r\n     */\r\n    TRADE_COIN_INNER_TRANSFER(1, "交易币内部转账"),\r\n    /**\r\n     * 支付币提币\r\n     */\r\n    TRADE_COIN_DRWA(2, "交易币提币"),\r\n\r\n    /**\r\n     * 支付币充币\r\n     */\r\n    TRADE_COIN_RECHARGE (3, "交易币充币"),\r\n    /**\r\n     *支付币内部转账\r\n     */\r\n    PAY_COIN_INNER_TRANSFER(4, "支付币内部转账"),\r\n    /**\r\n     * 支付币提币\r\n     */\r\n    PAY_COIN_DRWA(5, "支付币提币"),\r\n\r\n    /**\r\n     * 股权币充币\r\n     */\r\n    EQUITY_COIN_RECHARGE (6, "股权币充币"),\r\n    /**\r\n     *支付币内部转账\r\n     */\r\n    EQUITY_COIN_INNER_TRANSFER(7, "股权币内部转账"),\r\n    /**\r\n     * 支付币提币\r\n     */\r\n    EQUITY_COIN_DRWA(8, "股权币提币"),\r\n\r\n    /**\r\n     * 支付币充币\r\n     */\r\n    PAY_COIN_RECHARGE (9, "支付币充币");',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `status` tinyint(2) DEFAULT NULL COMMENT '状态：1：待审核，2：审核通过，3：审核通过，确认中  4：交易成功 5 已删除',
  `remark` varchar(2000) DEFAULT NULL COMMENT '备注',
  `rmbCovertEquityScale` decimal(16,4) DEFAULT '1.0000' COMMENT '人民币对股权币汇率',
  `RmbCovertPayAmtScale` decimal(16,4) DEFAULT '1.0000' COMMENT '人民币对支付币比例汇率',
  `RmbCovertTradeAmtScale` decimal(16,4) DEFAULT '1.0000' COMMENT '人民币对交易币比例汇率',
  `receviceUid` int(15) DEFAULT '0' COMMENT '收款用户uid',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='钱包提币转币订单表';

