-- ----------------------------
-- Table structure for `wallet_transaction`
-- ----------------------------
DROP TABLE IF EXISTS `wallet_transaction`;
CREATE TABLE `wallet_transaction` (
  `id` varchar(50) NOT NULL COMMENT '主键id',
  `userId` varchar(30) NOT NULL DEFAULT '' COMMENT '用户id',
  `txtId` varchar(100) DEFAULT '' COMMENT '交易id',
  `prepayId` varchar(100) DEFAULT '' COMMENT '预付单号',
  `transactionLongTime` bigint(20) DEFAULT '0' COMMENT '交易时间戳',
  `transactionTime` datetime DEFAULT NULL COMMENT '交易时间',
  `address` varchar(100) DEFAULT NULL COMMENT '钱包地址',
  `amount` decimal(10,0) DEFAULT '0' COMMENT '钱包地址',
  `category` varchar(20) DEFAULT '' COMMENT '交易类型',
  `fee` decimal(10,0) DEFAULT '0' COMMENT '钱包地址',
  `confirmations` int(11) DEFAULT '0' COMMENT '确认次数',
  `transactionStatus` varchar(20) DEFAULT '' COMMENT '交易状态',
  `status` tinyint(4) DEFAULT '0' COMMENT '1：确认中 2 交易成功 3 已删除',
  `createTime` datetime DEFAULT NULL,
  `updateTime` datetime DEFAULT NULL,
  `message` varchar(500) DEFAULT '',
  `orderType` int(4) DEFAULT '1' COMMENT '         /**\r\n     *交易币内部转账\r\n     */\r\n    TRADE_COIN_INNER_TRANSFER(1, "交易币内部转账"),\r\n    /**\r\n     * 支付币提币\r\n     */\r\n    TRADE_COIN_DRWA(2, "交易币提币"),\r\n\r\n    /**\r\n     * 支付币充币\r\n     */\r\n    TRADE_COIN_RECHARGE (3, "交易币充币"),\r\n    /**\r\n     *支付币内部转账\r\n     */\r\n    PAY_COIN_INNER_TRANSFER(4, "支付币内部转账"),\r\n    /**\r\n     * 支付币提币\r\n     */\r\n    PAY_COIN_DRWA(5, "支付币提币"),\r\n\r\n    /**\r\n     * 股权币充币\r\n     */\r\n    EQUITY_COIN_RECHARGE (6, "股权币充币"),\r\n    /**\r\n     *支付币内部转账\r\n     */\r\n    EQUITY_COIN_INNER_TRANSFER(7, "股权币内部转账"),\r\n    /**\r\n     * 支付币提币\r\n     */\r\n    EQUITY_COIN_DRWA(8, "股权币提币"),\r\n\r\n    /**\r\n     * 支付币充币\r\n     */\r\n    PAY_COIN_RECHARGE (9, "支付币充币")',
  `remark` varchar(300) DEFAULT NULL COMMENT '备注',
  `details` varchar(300) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='钱包交易记录表';

