INSERT INTO `base_task` VALUES ('D1C78686C1A2485D962487FC016414B1', '习近平向2017中国－阿拉伯国家博览会致贺信', '习近平向2017中国－阿拉伯国家博览会致贺信', null, 'http://tv.cctv.com/2017/09/06/VIDELkEoboRvSBBtKByakjAY170906.shtml', '1', '2017-09-06 11:53:23', '2017-09-06 11:53:23', '1', '央视网消息（新闻联播）：2017中国-阿拉伯国家博览会9月6日在宁夏银川开幕。国家主席习近平致贺信，对会议的召开表示热烈祝贺。\n\n习近平指出，中国同阿拉伯国家是好朋友、好伙伴。历史上，中阿因丝绸之路相知相交。在经济全球化深入发展的今天，中阿成为“一带一路”建设的重要合作伙伴，双方互利合作领域越来越广，成果越来越实。\n\n习近平强调，在今年5月举行的“一带一路”国际合作高峰论坛上，我提出要将“一带一路”建成和平之路、繁荣之路、开放之路、创新之路、文明之路，得到阿拉伯世界积极响应和广泛支持。本届博览会突出“务实、创新、联动、共赢”主题，契合“一带一路”国际合作理念，为中阿拓展合作搭建了重要平台。中国愿同包括阿拉伯国家在内的各国一道，推动“一带一路”建设共享机遇，共促和平。', null);
INSERT INTO `base_task` VALUES ('D70444763D3A4ED9A6BE2B5B4EFAB755', '伟大还是荒谬？华为带来全球首款手机AI芯片：NPU是噱头吗？', '伟大还是荒谬？华为带来全球首款手机AI芯片：NPU是噱头吗？', null, 'https://baijia.baidu.com/s?id=1577769606177483502&wfr=pc&fr=idx_lst', '1', '2017-09-06 11:55:39', '2017-09-06 11:55:39', '1', '9月2日晚，华为终于带来了新一代旗舰处理器麒麟970。作为少数能自主研发处理器的手机厂商，华为每代的处理器产品发布都会受到不少的关注。目前麒麟的旗舰处理器也完全可以在高端市场上和高通、三星一较高低。\n\n坦率地说，此次麒麟970在架构上和上代960相比没有变动，依然采用了4颗A73核心，而没有使用ARM最新的A75，算是一个遗憾。当然，从16nm到10nm是一个不小的进步，对功耗有极大的帮助。', null);
