INSERT INTO `base_user_task` VALUES ('3BFF6935AE294E9F9F382BE62A1F437A', '9B6233535CD348C2BAE2E2F2AD7426D8', 'D70444763D3A4ED9A6BE2B5B4EFAB755', '伟大还是荒谬？华为带来全球首款手机AI芯片：NPU是噱头吗？', '9月2日晚，华为终于带来了新一代旗舰处理器麒麟970。作为少数能自主研发处理器的手机厂商，华为每代的处理器产品发布都会受到不少的关注。目前麒麟的旗舰处理器也完全可以在高端市场上和高通、三星一较高低。\n\n坦率地说，此次麒麟970在架构上和上代960相比没有变动，依然采用了4颗A73核心，而没有使用ARM最新的A75，算是一个遗憾。当然，从16nm到10nm是一个不小的进步，对功耗有极大的帮助。', '1', 'https://baijia.baidu.com/s?id=1577769606177483502&wfr=pc&fr=idx_lst', '1', '2017-09-21 23:51:51', '2017-09-21 23:51:51', '2017-09-17', '1', '任务已分配', null);
