INSERT INTO `base_user_task` VALUES ('77ECC3FDD3454FEAB1ECC707127F36A0', 'FC3E25D0E4034432B7FB76980500A9A0', 'D1C78686C1A2485D962487FC016414B1', '习近平向2017中国－阿拉伯国家博览会致贺信', '央视网消息（新闻联播）：2017中国-阿拉伯国家博览会9月6日在宁夏银川开幕。国家主席习近平致贺信，对会议的召开表示热烈祝贺。\n\n习近平指出，中国同阿拉伯国家是好朋友、好伙伴。历史上，中阿因丝绸之路相知相交。在经济全球化深入发展的今天，中阿成为“一带一路”建设的重要合作伙伴，双方互利合作领域越来越广，成果越来越实。\n\n习近平强调，在今年5月举行的“一带一路”国际合作高峰论坛上，我提出要将“一带一路”建成和平之路、繁荣之路、开放之路、创新之路、文明之路，得到阿拉伯世界积极响应和广泛支持。本届博览会突出“务实、创新、联动、共赢”主题，契合“一带一路”国际合作理念，为中阿拓展合作搭建了重要平台。中国愿同包括阿拉伯国家在内的各国一道，推动“一带一路”建设共享机遇，共促和平。', '1', 'http://tv.cctv.com/2017/09/06/VIDELkEoboRvSBBtKByakjAY170906.shtml', '1', '2017-09-21 23:46:37', '2017-09-21 23:48:01', '2017-09-18', '2', '用户于2017-09-21 23:48:01完成任务', null);
